import React from "react";

import "./CastMembers.css";

function CastMembers(props) {
  let totalCast = 2
  let casts = [
    {
      name: "Jesuye David",
      id: 1,
    },
    {
      name: "Cast Member",
      id: 2,
    },
  ]

  function addNewCastMember(){
    totalCast +=1

    let newCast = {
      name: "Cast Member",
      id: totalCast
    }

    casts.push(newCast)
  }

  return (
    <div className="CastMembers">
      {casts.map((value, index) => {
        <div id={"CastMembers-cast-" + value} className="CastMembers-cast" key={index}>
          {value}
        </div>
      })}

      <div className="CastMembers-addCast" onClick={addNewCastMember()}>
        +
      </div>
    </div>
  );
}

export default CastMembers;
